import React, {useState, useEffect} from 'react';
import './App.css';

function App() {
  const [testMessage, setTestMessage] = useState();

  //This function grabs data from flasks "/test" route and stores it in testMessage
  useEffect(() => {
    fetch('/test').then(res => res.json()).then(data => {
      setTestMessage(data.message);
    });
  }, [])

  return (
    <div>
      <p>This is the message: {testMessage}</p>
      <div>Welcome to a pure skeleton of what will soon become a TA Assignment application</div>
      <div>Please select your role</div>
      <a href="{{url_for('uta_home')}}"><button>UTA</button></a>
      <a href="{{url_for('ptig_home')}}"><button>PTIG</button></a>
      <a href="{{url_for('gradta_home')}}"><button>Grad-TA</button></a>
      <a href="{{url_for('faculty_home')}}"><button>faculty</button></a>
      <a href="{{url_for('admin_home')}}"><button>admin</button></a>
    </div>
  );
}

export default App;
